import React from 'react'

const PlayerCard = ({name, img, statistics}) => {
  return (
    <div className='card'>
        <div className='img-container'>
            <img src={img} alt={name} />
        </div>
        <h3 className='card-info'>{name}</h3>
    </div>
  )
}

export default PlayerCard
